Перманентно записываю всякие мелочи, которые я хочу найти, узнать, прочитать, послушать или сделать, на попавшихся под руку  бумажках;

Считаю, что любить себя можно и нужно не чаще двух раз в месяц в темноте и полном одиночестве, остальное же время посвятить самоограничению и самоуничижению, не забывая говорить себе, что ты можешь и должен быть добрее, заниматься усерднее и поступать рассудительнее.

Хочу все знать.
